import { useRef, useState } from "react";
import "./App.css"
import FormInput from "./components/FormInputs";

const App = () => {
    // const [Aadhar,setAadharNumber] = useState("")

    console.log("re-rendered")

    const handleSubmit = (e)=>{
        e.preventDefault();
        const data = new FormData(e.target)
    }
    return <div className="app">
        <form onSubmit={handleSubmit}>
            <FormInput name="aadhar" placeholder="Aadhar number"/>
            <FormInput name="bloodg" placeholder="Blood group"/>
            <FormInput name="pulser" placeholder="Pulse rate"/>
            <FormInput name="oxy" placeholder="Oxygen Level"/>
            <FormInput name="temps" placeholder="Temperature"/>
            <FormInput name="disease" placeholder="Disease/Medical Condition"/>
            <FormInput name="pincode" placeholder="Pincode"/>
            <button>Submit</button>
        </form>
    </div>
};

export default App;
